   "source": [
    "# Avocado Price Forecasting\n",
    "## Author: Kavita Khandelwal\n",
    "\n",
    "\n",
    "\n",
    "##  Introduction\n",
    "This data represents weekly 2018 retail scan data for National retail volume (units) and price. Retail scan data comes directly from retailers’ cash registers based on actual retail sales of Hass avocados. Starting in 2013, the data reflects an expanded, multi-outlet retail data set. Multi-outlet reporting includes an aggregation of the following channels: grocery, mass, club, drug, dollar and military. The Average Price (of avocados) in the table reflects a per unit (per avocado) cost, even when multiple units (avocados) are sold in bags. The Product Lookup codes (PLU’s) in the table are only for Hass avocados. Other varieties of avocados (e.g. greenskins) are not included in this table.\n",
    "\n",
    "\n",
    "##  Ask\n",
    " \n",
    "####  Time Series Forecasting\n",
    "* Time series forecasting to find out any trends and seasonal patterns.\n",
    "\n",
    "\n",
    "##  Prepare\n",
    "####  Data Information\n",
    "This data was downloaded from the Hass Avocado Board website in May of 2018 & compiled into a single CSV. This is a public dataset and can be downloaded from [here](https://www.kaggle.com/neuromusic/avocado-prices).\n",
    "\n",
    "\n",
    "\n",
    "# Forecasting\n",
    "\n",
    "### Time series patterns:\n",
    " **1. Trend:** A trend exists when there is a **long-term (or consistent) increase or decrease in the data.**\n",
    " \n",
    "**2. Seasonal:** A seasonal pattern occurs when a time series is affected by seasonal factors such as the time of the year or the day of the week. **Fluctuations do happen on a fixed and known frequency. For example diwali, christmas sale come every year.**\n",
    "\n",
    "**3. Irregularity/Cyclic:** A cycle occurs when the data exhibit rises and falls that are not of a fixed frequency. These fluctuations are usually due to economic conditions, and are often related to the “business cycle.” The duration of these fluctuations is usually at least 2 years. **Fluctuations do not happen on a fixed frequency. For example flight cancles due to fog in november but it is not going to happen every year.**\n"
   ]
  },
