   "source": [
    "# adding new column-month\n",
    "avocado_df$month <- format(as.Date(avocado_df$Date), \"%B\")\n",
    "#avocado_df\n",
    "\n",
    "# order month name\n",
    "avocado_df$month <- ordered(avocado_df$month, levels=c(\"January\", \"February\",\"March\", \"April\", \"May\", \"June\", \"July\", \"August\", \"September\", \"October\", \"November\", \"December\"))\n",
    "#avocado_df\n",
    "\n",
    "#avocado_df%>% group_by(year, month, type)%>% summarize(Average_Price= mean(AveragePrice))\n",
    "\n",
    "#filter data\n",
    "organic_df <- avocado_df%>% group_by(year, month, type)%>% summarize(Average_Price= mean(AveragePrice))%>% \n",
    "              filter(type == \"organic\") \n",
    "organic_df\n",
    "\n",
    "conventional_df <- avocado_df%>% group_by(year, month, type)%>% summarize(Average_Price= mean(AveragePrice))%>% \n",
    "            filter(type == \"conventional\")\n",
    "conventional_df\n"
   ]
