   "source": [
    "# plot the time series data/ time plot:\n",
    "\n",
    "#plot(organic_ts, xlab= \"Year\", ylab= \"Organic Avocado Price\", main = \"Avocado Price: Organic \")\n",
    "#or\n",
    "#autoplot(organic_ts) + ggtitle(\"Avocado Price: Organic\") + xlab(\"Year\") + ylab(\"Organic Avocado Price\")\n",
    "#or\n",
    "plot_a<- autoplot(organic_ts) + labs(title = \"Avocado Price: Organic\", x= \"Year\", y= \"Average Price\")\n",
    "\n",
    "\n",
    "#plot(conventional_ts)\n",
    "plot_b<- autoplot(conventional_ts)+ labs(title = \"Avocado Price: Conventional\", x= \"Year\", y= \"Average Price\")\n",
    "\n",
    "\n",
    "# put plot_a and plot_b together\n",
    "options(repr.plot.width= 15, repr.plot.height=6)\n",
    "grid.arrange(plot_a,plot_b, ncol=2)\n"
   ]
  },
