   "source": [
    "At this point we could guess that this time series could be described using an multiplicative model, since the random fluctuations in the data change over time.\n",
    "\n",
    "**The time plot(autoplot) immediately reveals some interesting features. Following are the observations obtained from above figure:**\n",
    "\n",
    "1. Data values are stored in correct time order and no data is missing.\n",
    "2. A large increase in price occurred in the starting of second half of 2017 for both organic and conventional types.\n",
    "3. There are some dips in price around the start of each year for conventional type.\n",
    "4. The lowest price occured in the year of 2017 for organic type and in year 2016 for conventional type."
   ]
