   "source": [
    "## Step 2: Existence of seasonality is observed using various plots\n",
    "#Plot 1: Seasonal plot year-wise( using ggseasonplot())\n",
    "\n",
    "\n",
    "# for organic:\n",
    "plot_c<- ggseasonplot(organic_ts, year.labels=TRUE, year.labels.left=TRUE) +\n",
    "  ylab(\"Average Price\") +\n",
    "  ggtitle(\"Seasonal plot: Monthly Average Price for Organic Avocado\")\n",
    "\n",
    "\n",
    "# for conventional:\n",
    "plot_d <- ggseasonplot(conventional_ts, year.labels=TRUE, year.labels.left=TRUE) +\n",
    "  ylab(\"Average Price\") +\n",
    "  ggtitle(\"Seasonal plot: Monthly Average Price for Conventional Avocado\")\n",
    "\n",
    "\n",
    "# put plot_a and plot_b together\n",
    "options(repr.plot.width= 15, repr.plot.height=6)\n",
    "grid.arrange(plot_c,plot_d, ncol=2)"
   ]
  },
