    "# Plot 2: Polar Seasonal plot year-wise( using ggseasonplot())\n",
    "\n",
    "\n",
    "# for organic:\n",
    "plot_e<- ggseasonplot(organic_ts, polar=TRUE) +\n",
    "  ylab(\"Average Price\") +\n",
    "  ggtitle(\"Polar Seasonal plot: Average Price for Organic Avocado\")\n",
    "\n",
    "\n",
    "# for conventional:\n",
    "plot_f <- ggseasonplot(conventional_ts, polar = TRUE) +\n",
    "  ylab(\"Average Price\") +\n",
    "  ggtitle(\"Polar Seasonal plot: Monthly Average Price for Conventional Avocado\")\n",
    "\n",
    "\n",
    "# put plot_a and plot_b together\n",
    "options(repr.plot.width= 15, repr.plot.height=6)\n",
    "grid.arrange(plot_e,plot_f, ncol=2)"
   ]
