   "source": [
    "In the above figure, the vertical lines represent monthly prices and the horizontal lines represent mean price for each month. \n",
    "\n",
    "**Summary:**\n",
    "\n",
    "**Upward Trend:** The most significant upward trend for mean price happens between **February to September for organic** avocados and **May to October for conventional avocado** types. Both types of avocados have a similar trend.\n",
    "\n",
    "**Most expensive months to buy avocados:** Here, it can be observed that the mean prices are **higher in September and October** compared to other months for both type of avocado. However, August is pretty expensive as well. It is especially useful in identifying changes within particular seasons. "
   ]
