   "source": [
    "We can not see any trend here. This is monthly data and there are 12 seasonal indices. For seasonal component, in **October for conventional** type and in **September & October for organic** type price is the **highest**  among all month in the same year whereas in **March for organic** type and in **February for conventional** type price is the **lowest**."
