    "# Step 2: Decomposition of TS using stl()\n",
    "TSDecomposeLog_organic <- stl(log10(organic_ts), \"periodic\")\n",
    "TSDecomposeLog_organic\n",
    "plot(TSDecomposeLog_organic)\n",
    "\n",
    "\n",
    "TSDecomposeLog_conventional <- stl(log10(conventional_ts), s.window=\"periodic\")\n",
    "TSDecomposeLog_conventional\n",
    "plot(TSDecomposeLog_conventional)"
   ]
