    "## Step 1: spliting data into traing and test data sets\n",
    "TSorganic_train <- window(organic_ts, start = c(2015, 1), end = c(2016,12), frequency =12)\n",
    "TSorganic_test <- window(organic_ts, start = c(2017, 1), end = c(2017,12), frequency =12)\n",
    "\n",
    "\n",
    "TSconventional_train <- window(conventional_ts, start = c(2015, 1), end = c(2016,12), frequency =12)\n",
    "TSconventional_test <- window(conventional_ts, start = c(2017, 1), end = c(2017,12), frequency =12)\n"
   ]
