   "source": [
    "**Meaning of ACF and PACF**\n",
    "\n",
    "**ACF is an (complete) auto-correlation function which gives us values of auto-correlation of any series with its lagged values. We plot these values along with the confidence band. We have an ACF plot. In simple terms, it describes how well the present value of the series is related with its past values. A time series can have components like trend, seasonality, cyclic and residual. ACF considers all these components while finding correlations hence it’s a ‘complete auto-correlation plot’.**\n",
    "\n",
    "\n",
    "**PACF is a partial auto-correlation function. Basically instead of finding correlations of present with lags like ACF, it finds correlation of the residuals (which remains after removing the effects which are already explained by the earlier lag(s)) with the next lag value hence ‘partial’ and not ‘complete’ as we remove already found variations before we find the next correlation. So if there is any hidden information in the residual which can be modeled by the next lag, we might get a good correlation and we will keep that next lag as a feature while modeling. Remember while modeling we don’t want to keep too many features which are correlated as that can create multicollinearity issues. Hence we need to retain only the relevant features.**\n",
    "\n",
    "**Autocorrelations**\n",
    "Autocorrelations helps us determine if there are certain patterns in our data. So what is the main purpose of using Autocorrelations and how could it help us determine certain patterns in our time series dataset? First thing, the word \"Auto\" gives us a hint that we are planning to use an internal correlation. What does internal correlation mean? We basically are taking a specific date (in the example below we use January) and we want to see whether the price of avocados have some sort of correlation with the price of January. In the first visualization, lags are a representation of months. So we can see that the correlation is higher the closer the month is from January/ This means that the price of February are similar to the avocado prices of January. As the months pass by, the correlation as opposed to the month of January gets lower indicating to us that there are no specific patterns to the month of January. Price movements in those months except for February and March do not have highly correlated prices compared to the prices of January.\n",
    "\n"
   ]
