    "ACF of the residuals from the drift method applied to the conventional avocado price. The lack of correlation suggesting the forecasts are good.\n",
    "\n",
    "These graphs show that the drift method produces forecasts that appear to account for all available information. The mean of the residuals is close to zero and there is no significant correlation in the residuals series. The time plot of the residuals shows that the variation of the residuals stays much the same across the historical data, apart from the one outlier, and therefore the residual variance can be treated as constant. This can also be seen on the histogram of the residuals. The histogram suggests that the residuals may not be normal — the left tail seems a little too long, even when we ignore the outlier. Consequently, forecasts from this method will probably be quite good, but prediction intervals that are computed assuming a normal distribution may be inaccurate.\n",
    "\n",
    "\n",
    "**Since residual SD is minimum for naive so it is the best method for organic and conventional avocado in all methods.**\n"
