   "source": [
    "\n",
    "# Organinc avocado: \n",
    "#Plot some forecasts \n",
    "autoplot(organic_ts) +\n",
    "  autolayer(organicPrice_mean, series=\"Mean\", PI=FALSE) +\n",
    "  autolayer(organicPrice_naive, series=\"Naïve\", PI=FALSE) +\n",
    "  autolayer(organicPrice_seasonalnaive, series=\"Seasonal naïve\", PI=FALSE) + \n",
    "  autolayer(organicPrice_drift, series=\"Drift\", PI=FALSE) +\n",
    "  #autolayer(TSorganic_test, series = \"Test\") + \n",
    "  ggtitle(\"Organic Avocado: Forecast by Mean, Naïve, Seasonal naïve,Drift Methods for year 2018\") +\n",
    "  xlab(\"Year\") + ylab(\"Price\") +\n",
    "  guides(colour=guide_legend(title=\"Forecast\")) \n",
    "\n",
    "\n",
    "\n",
    "# conventional avocado: \n",
    "#Plot some forecasts \n",
    "autoplot(conventional_ts) +\n",
    "  autolayer(conventionalPrice_mean, series=\"Mean\", PI=FALSE) +\n",
    "  autolayer(conventionalPrice_naive, series=\"Naïve\", PI=FALSE) +\n",
    "  autolayer(conventionalPrice_seasonalnaive, series=\"Seasonal naïve\", PI=FALSE) + \n",
    "autolayer(conventionalPrice_drift, series=\"Drift\", PI=FALSE) +\n",
    "  #autolayer(TSconventional_test, series = \"Test\") + \n",
    "  ggtitle(\"Conventional Avocado: Forecast by Mean, Naïve, Seasonal naïve,Drift Methods for year 2018\") +\n",
    "  xlab(\"Year\") + ylab(\"Price\") +\n",
    "  guides(colour=guide_legend(title=\"Forecast\")) "
   ]
