    "# organic\n",
    "organic_ts_d <- diff(organic_ts)\n",
    "a<- autoplot(organic_ts_d)\n",
    "b<- ggseasonplot(organic_ts_d)\n",
    "c<- ggsubseriesplot(organic_ts_d)\n",
    "\n",
    "# conventional\n",
    "conventional_ts_d <- diff(conventional_ts)\n",
    "aa<- autoplot(conventional_ts_d)\n",
    "bb<-ggseasonplot(conventional_ts_d)\n",
    "cc<-ggsubseriesplot(conventional_ts_d)\n",
    "\n",
    "# put plot_a and plot_b together\n",
    "options(repr.plot.width= 20, repr.plot.height=10)\n",
    "grid.arrange(a,b,c,aa,bb,cc, ncol=3, nrow= 2)"
   ]
