    "tags": []
   },
   "source": [
    "#### Understanding ARIMA Model:\n",
    "\n",
    "**Auto Regressive (AR):** Means that past time points could have a certain degree of current and future time observations. The ARIMA model takes into account lagged observations in order to come up with forecast observations. A weight is added to past observations however, the weight can vary on how recent the past observations are. The more recent, the more weight is added to the most recent past observation.\n",
    "\n",
    "**Integrated (I):** If there are consistent trends in the movement of past prices, it is most likely to be non-stationary meaning that seasonality persists in past movement of prices. Integrated removes the seasonality phase of our dataset in case there are consistent patterns that show that this is the case. The degree of differencing available in ARIMA models eliminates the seasonality trend issue.\n",
    "\n",
    "**Moving Average (MA):** Moving average helps remove the effect of random movements of avocado prices in our case. If there was an extraordinary event that led to a surge in avocado prices, moving average will help us \"smooth\" things up and our time series model will not be prone to these fluctuations."
   ]
  },
