   "source": [
    "# for organic type\n",
    "# d = 1 for first difference to remove trend\n",
    "# D = 1 for first difference to remove seasonality\n",
    "fit_arimaO <- auto.arima(organic_ts, d=1, D=1,stepwise = FALSE, approximation= FALSE, trace = TRUE) # Residual SD= (0.007843)^1/2 = 0.0039\n",
    "print(summary(fit_arimaO))\n",
    "checkresiduals(fit_arimaO)\n",
    "\n",
    "\n",
    "# for conventional type\n",
    "fit_arimaC <- auto.arima(conventional_ts, d=1, D=1,stepwise = FALSE, approximation= FALSE, trace = TRUE) # Residual SD= (0.01386)^1/2 = 0.006\n",
    "print(summary(fit_arimaC))\n",
    "checkresiduals(fit_arimaC)"
   ]
